A SIMPLE model can be written in a .spl or .json file. The .spl format is meant to be more human-readable. (.json files are meant to be read and written by machines, mostly). A .spl file starts by identifying the object type (e.g., SiteDetails or Substance) followed by a set of corresponding properties of the object being described. Comments can be added with // for single lines and /*... */ for multi lines. Here’s a sample basic model written in .spl syntax: // This is a single line comment
/*
Comments can have multiple lines
So you can explain thigs better: 1. By adding lists
2. And longer comments. */ // This describes the environment of the model
SiteDetails { altitude : 0.0, // it is at sea level terrain : "City", // in a city latitude : -41.0, // at this latitude longitude : 174.0, // at this loingitude standard_meridian : 180.0, // this defines the timezone, basically
} // This describes a building
Building { name: "Art Deco Building", n_storeys: 2, // it has 2 storeys shelter_class: "Urban", // It is shelter as you would expect in a city
}

