let kids_heater = hvac("Kids heater"); let temperature = kids_bedroom.dry_bulb_temperature; if temperature < 18 { kids_heater.power_consumption = 1000
} else if temperature > 23 { if rand() > 0.82 { kids_heater.power_consumption = 0 } else { print("Oh oh! I forgot to turn the heater off!") }
